import './GaleriaVirtual.css'

export default function GaleriaVirtual() {
    return (
        <div className='GaleriaVirtual'>
            <h1>Proxima Galeria Virtual </h1>
            <div className='Recuadros'>
                <p>21/10/2021</p>             
            </div>
        </div>
    );
}
